            const F = (this.a - this.d) * 0.5;
            const G = (this.b + this.c) * 0.5;
            const H = (this.b - this.c) * 0.5;

            const Q = Math.sqrt(E * E + H * H);
            const R = Math.sqrt(F * F + G * G);
            const scaleX = Q + R;
            const scaleY = Q - R;

            const a1 = Math.atan2(G, F);
            const a2 = Math.atan2(H, E);
            const theta = (a2 - a1) * 0.5;
            const phi = (a2 + a1) * 0.5;

