                Math.abs(this.b - that.b) < precision &&
                Math.abs(this.c - that.c) < precision &&
                Math.abs(this.d - that.d) < precision &&
                Math.abs(this.e - that.e) < precision &&
                Math.abs(this.f - that.f) < precision
